import React, { useState } from 'react';
import {
  Typography,
  TextField,
  Box
} from '@mui/material';

const AddressForm = () => {
  const [formData, setFormData] = useState({
    correspondence: {
      address: '',
      country: '',
      state: '',
      district: '',
      pinCode: '',
      mobile: '',
      email: ''
    },
    permanent: {
      address: '',
      country: '',
      state: '',
      district: '',
      pinCode: '',
      mobile: '',
      email: ''
    },
    otherInfo: ''
  });

  const handleChange = (section, field, value) => {
    setFormData((prev) => ({
      ...prev,
      [section]: {
        ...prev[section],
        [field]: value
      }
    }));
  };

  return (
    <Box sx={{ p: 8, border: '1px solid #ccc', borderRadius: 2 }}>
      {/* Correspondence Address */}
      <Typography variant="h6" gutterBottom>Correspondence Address</Typography>
      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 2, mb: 3 }}>
        <TextField label="Address" value={formData.correspondence.address} onChange={(e) => handleChange('correspondence', 'address', e.target.value)} size="small" />
        <TextField label="Country" value={formData.correspondence.country} onChange={(e) => handleChange('correspondence', 'country', e.target.value)} size="small" />
        <TextField label="State" value={formData.correspondence.state} onChange={(e) => handleChange('correspondence', 'state', e.target.value)} size="small" />
        <TextField label="District" value={formData.correspondence.district} onChange={(e) => handleChange('correspondence', 'district', e.target.value)} size="small" />
        <TextField label="Pin Code" value={formData.correspondence.pinCode} onChange={(e) => handleChange('correspondence', 'pinCode', e.target.value)} size="small" />
        <TextField label="Mobile No." value={formData.correspondence.mobile} onChange={(e) => handleChange('correspondence', 'mobile', e.target.value)} size="small" />
        <TextField label="Email ID" value={formData.correspondence.email} onChange={(e) => handleChange('correspondence', 'email', e.target.value)} size="small" />
      </Box>

      {/* Permanent Address */}
      <Typography variant="h6" gutterBottom>Permanent Address</Typography>
      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 2, mb: 3 }}>
        <TextField label="Address" value={formData.permanent.address} onChange={(e) => handleChange('permanent', 'address', e.target.value)} size="small" />
        <TextField label="Country" value={formData.permanent.country} onChange={(e) => handleChange('permanent', 'country', e.target.value)} size="small" />
        <TextField label="State" value={formData.permanent.state} onChange={(e) => handleChange('permanent', 'state', e.target.value)} size="small" />
        <TextField label="District" value={formData.permanent.district} onChange={(e) => handleChange('permanent', 'district', e.target.value)} size="small" />
        <TextField label="Pin Code" value={formData.permanent.pinCode} onChange={(e) => handleChange('permanent', 'pinCode', e.target.value)} size="small" />
        <TextField label="Mobile No." value={formData.permanent.mobile} onChange={(e) => handleChange('permanent', 'mobile', e.target.value)} size="small" />
        <TextField label="Email ID" value={formData.permanent.email} onChange={(e) => handleChange('permanent', 'email', e.target.value)} size="small" />
      </Box>

      {/* Other Info */}
      <Typography variant="h6" gutterBottom>Other Details</Typography>
      <TextField
        label="Any Other Relevant Information"
        multiline
        rows={3}
        value={formData.otherInfo}
        onChange={(e) => setFormData({ ...formData, otherInfo: e.target.value })}
        size="small"
        sx={{ width: '100%' }}
      />
    </Box>
  );
};

export default AddressForm;
